import React, { useEffect, useState } from "react";
import { transportAPI } from "../services/api";
import "./TransportDashboard.css";

const TransportDashboard = () => {
  const transporter = JSON.parse(localStorage.getItem("transporter"));
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);

  // ‚úÖ Fetch assigned transport orders
  useEffect(() => {
    if (transporter) {
      transportAPI
        .getOrders(transporter.id)
        .then((res) => {
          setOrders(res.data || []); // ensure empty [] if none
        })
        .catch((err) => {
          console.error("Error fetching transport orders:", err);
          alert("‚ö†Ô∏è Failed to load assigned transports.");
        })
        .finally(() => setLoading(false));
    }
  }, [transporter]);

  // ‚úÖ Update delivery status
  const handleStatusUpdate = async (orderId, newStatus) => {
    try {
      await transportAPI.updateStatus(orderId, newStatus);
      alert(`‚úÖ Order marked as ${newStatus}!`);
      setOrders((prev) =>
        prev.map((order) =>
          order.orderId === orderId ? { ...order, status: newStatus } : order
        )
      );
    } catch (err) {
      console.error("Error updating status:", err);
      alert("‚ùå Could not update status. Try again.");
    }
  };

  if (!transporter) {
    return (
      <div className="auth-container">
        <h2>‚ö†Ô∏è Please log in as a transporter.</h2>
      </div>
    );
  }

  return (
    <div className="dashboard-container">
      <h1>üöõ Transporter Dashboard</h1>
      <p>Welcome, <b>{transporter.name}</b></p>

      {loading ? (
        <p>‚è≥ Loading assigned orders...</p>
      ) : orders.length === 0 ? (
        <p>No transport orders assigned yet.</p>
      ) : (
        <table className="orders-table">
          <thead>
            <tr>
              <th>Order ID</th>
              <th>Farmer</th>
              <th>Retailer</th>
              <th>Vehicle</th>
              <th>Driver</th>
              <th>Contact</th>
              <th>Status</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
            {orders.map((order) => (
              <tr key={order.transportId}>
                <td>{order.orderId}</td>
                <td>{order.farmerName || "‚Äî"}</td>
                <td>{order.retailerName || "‚Äî"}</td>
                <td>{order.vehicleNo}</td>
                <td>{order.driverName}</td>
                <td>{order.contact}</td>
                <td>{order.status}</td>
                <td>
                  {order.status === "Assigned" && (
                    <button
                      onClick={() =>
                        handleStatusUpdate(order.orderId, "On the Way")
                      }
                    >
                      üöö Start Delivery
                    </button>
                  )}
                  {order.status === "On the Way" && (
                    <button
                      onClick={() =>
                        handleStatusUpdate(order.orderId, "Delivered")
                      }
                    >
                      ‚úÖ Mark Delivered
                    </button>
                  )}
                  {order.status === "Delivered" && <span>‚úÖ Delivered</span>}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default TransportDashboard;
